      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT 16 * + col2 * + col2 * + col1 IN ( - col2, + CAST ( + - col0 AS INTEGER ), + col0, col1 );
  - name: tab1

outputs:
  - name: q10376.out
    data: |
      51	14	96
      85	5	59
      91	47	68
